# Frame extraction function
def capture_frames(video_path, output_folder, interval=2):
    cap = cv2.VideoCapture(video_path)
    count = 0
    while cap.isOpened():
        ret, frame = cap.read()
        if not ret:
            break
        # Save a frame every `interval` seconds
        if int(cap.get(cv2.CAP_PROP_POS_MSEC)) % (interval * 1000) == 0:
            frame_filename = os.path.join(output_folder, f"{os.path.basename(video_path)}_frame_{count}.jpg")
            cv2.imwrite(frame_filename, frame)
            count += 1
    cap.release()

# Process videos
