# Function to extract frames from video
def extract_frames(video_path, output_folder, frames_per_second=3):
    video_name = os.path.splitext(os.path.basename(video_path))[0]
    cap = cv2.VideoCapture(video_path)

    if not cap.isOpened():
        print(f"Error: Cannot open video {video_path}")
        return

    fps = int(cap.get(cv2.CAP_PROP_FPS))
    frame_interval = fps // frames_per_second
    frame_count = 0

    while True:
        ret, frame = cap.read()
        if not ret:
            break

        if frame_count % frame_interval == 0:
            frame_id = frame_count // frame_interval
            frame_filename = os.path.join(output_folder, f"{video_name}_frame_{frame_id}.jpg")
            cv2.imwrite(frame_filename, frame)

        frame_count += 1

    cap.release()
    print(f"Frames extracted from {video_name} saved in {output_folder}")

# Iterate through videos in the folder
for video_file in os.listdir(VIDEO_FOLDER):
    if video_file.endswith(('.wbm', '.avi')):
        video_path = os.path.join(VIDEO_FOLDER, video_file)
        extract_frames(video_path, FRAMES_FOLDER)

