"""Feature Extraction: Eye and Mouth Landmark Detection :updated"""

import dlib
from imutils import face_utils
import numpy as np
import os
import cv2
import pandas as pd

# Paths
preprocessed_folder = "/content/drive/MyDrive/Final project/dataset/preprocessed"  # Update with preprocessed path
shape_predictor_path = "/content/drive/MyDrive/Final project/shape_predictor_68_face_landmarks.dat"
output_csv = "/content/drive/MyDrive/Final project/features.csv"

# Dlib setup
detector = dlib.get_frontal_face_detector()
predictor = dlib.shape_predictor(shape_predictor_path)

# EAR Calculation
def calculate_ear(eye):
    A = np.linalg.norm(eye[1] - eye[5])
    B = np.linalg.norm(eye[2] - eye[4])
    C = np.linalg.norm(eye[0] - eye[3])
    ear = (A + B) / (2.0 * C)
    return ear

# MAR Calculation (Mouth Aspect Ratio)
def calculate_mar(mouth):
    A = np.linalg.norm(mouth[13] - mouth[19])  # Vertical distance
    B = np.linalg.norm(mouth[14] - mouth[18])
    C = np.linalg.norm(mouth[15] - mouth[17])
    D = np.linalg.norm(mouth[12] - mouth[16])  # Horizontal distance
    mar = (A + B + C) / (3.0 * D)
    return mar

# Process and extract features
def extract_features(image_path):
    image = cv2.imread(image_path)
    gray = cv2.cvtColor(image, cv2.COLOR_BGR2GRAY)
    faces = detector(gray)
    features = {"ear": None, "mar": None}

    if len(faces) == 0:
        #print(f"No face detected in {image_path}. Skipping...")
        return None

    for face in faces:
        shape = predictor(gray, face)
        shape = face_utils.shape_to_np(shape)

        # Eye landmarks
        left_eye = shape[36:42]
        right_eye = shape[42:48]
        avg_ear = (calculate_ear(left_eye) + calculate_ear(right_eye)) / 2.0
        features["ear"] = avg_ear

        # Mouth landmarks
        mouth = shape[48:68]
        mar = calculate_mar(mouth)
        features["mar"] = mar

        # Return after processing the first face
        break
    return features

# Apply feature extraction to all images
def extract_features_from_folder(input_folder, output_csv):
    data = []
    for category in os.listdir(input_folder):
        category_path = os.path.join(input_folder, category)
        if os.path.isdir(category_path):
            #print(f"Processing category: {category}")
            for image_file in os.listdir(category_path):
                if image_file.endswith((".jpg", ".png", ".jpeg")):
                    image_path = os.path.join(category_path, image_file)
                    features = extract_features(image_path)

                    # Save features if valid
                    if features:
                        data.append({
                            "image": image_file,
                            "category": category,
                            "ear": features["ear"],
                            "mar": features["mar"]
                        })

    # Save to CSV
    df = pd.DataFrame(data)
    df.to_csv(output_csv, index=False)
    print(f"Features saved to {output_csv}")

# Run feature extraction
extract_features_from_folder(preprocessed_folder, output_csv)
