def balance_classes(input_folder, output_folder, target_count):
    for category in os.listdir(input_folder):
        category_path = os.path.join(input_folder, category)
        output_category_path = os.path.join(output_folder, category)
        os.makedirs(output_category_path, exist_ok=True)

        if os.path.isdir(category_path):
            images = [f for f in os.listdir(category_path) if f.endswith(('.jpg', '.png', '.jpeg'))]

            # Limit all categories to the target count
            if len(images) > target_count:
                images = random.sample(images, target_count)

            # Copy images to the balanced folder
            for image in images:
                src = os.path.join(category_path, image)
                dst = os.path.join(output_category_path, image)
                shutil.copy(src, dst)
