import cv2
import numpy as np
import random
import os
from tqdm import tqdm
import shutil

# Enhanced augmentation configuration
augmentation_config = {
    "angle_range": (-30, 30),         # Larger rotation range
    "brightness_range": (0.5, 1.5),  # Wider brightness range
    "zoom_range": (0.8, 1.2),        # Zoom in and out
    "noise_mean": 0,                 # Gaussian noise mean
    "noise_std": 25,                 # Higher noise standard deviation
    "blur_kernel": (5, 5),           # Gaussian blur kernel size
    "crop_fraction": 0.2             # Fraction of image to randomly crop
}

# Augmentation functions
def random_rotation(image, angle_range):
    """Rotate image randomly within a specified angle range."""
    angle = random.uniform(*angle_range)
    h, w = image.shape[:2]
    rotation_matrix = cv2.getRotationMatrix2D((w / 2, h / 2), angle, 1.0)
    return cv2.warpAffine(image, rotation_matrix, (w, h))

def horizontal_flip(image):
    """Flip the image horizontally."""
    return cv2.flip(image, 1)

def vertical_flip(image):
    """Flip the image vertically."""
    return cv2.flip(image, 0)

def random_crop(image, crop_fraction):
    """Randomly crop a portion of the image."""
    h, w = image.shape[:2]
    crop_h, crop_w = int(h * crop_fraction), int(w * crop_fraction)
    start_h, start_w = random.randint(0, crop_h), random.randint(0, crop_w)
    end_h, end_w = h - random.randint(0, crop_h), w - random.randint(0, crop_w)
    cropped_image = image[start_h:end_h, start_w:end_w]
    return cv2.resize(cropped_image, (w, h))

def random_zoom(image, zoom_range):
    """Randomly zoom in or out of the image."""
    h, w = image.shape[:2]
    zoom_factor = random.uniform(*zoom_range)
    new_h, new_w = int(h * zoom_factor), int(w * zoom_factor)
    resized = cv2.resize(image, (new_w, new_h))
    if zoom_factor > 1.0:
        # Crop to original size
        start_h = (new_h - h) // 2
        start_w = (new_w - w) // 2
        return resized[start_h:start_h + h, start_w:start_w + w]
    else:
        # Pad to original size
        top_pad = (h - new_h) // 2
        left_pad = (w - new_w) // 2
        return cv2.copyMakeBorder(resized, top_pad, h - new_h - top_pad, left_pad, w - new_w - left_pad, cv2.BORDER_CONSTANT)

def adjust_brightness(image, factor_range):
    """Adjust brightness."""
    factor = random.uniform(*factor_range)
    return np.clip(image * factor, 0, 255).astype(np.uint8)

def add_gaussian_noise(image, mean, std):
    """Add Gaussian noise."""
    noise = np.random.normal(mean, std, image.shape).astype(np.uint8)
    return cv2.add(image, noise)

def apply_blur(image, blur_kernel):
    """Apply Gaussian blur."""
    return cv2.GaussianBlur(image, blur_kernel, 0)

# Augmentation pipeline
def augment_image(image, config):
    """Generate augmented versions of an image based on config."""
    augmented_images = []
    augmented_images.append(random_rotation(image, config["angle_range"]))       # Rotation
    augmented_images.append(horizontal_flip(image))                              # Horizontal Flip
    augmented_images.append(vertical_flip(image))                                # Vertical Flip
    augmented_images.append(random_crop(image, config["crop_fraction"]))         # Random Crop
    augmented_images.append(random_zoom(image, config["zoom_range"]))            # Zoom
    augmented_images.append(adjust_brightness(image, config["brightness_range"]))# Brightness adjustment
    augmented_images.append(add_gaussian_noise(image, config["noise_mean"], config["noise_std"])) # Noise addition
    augmented_images.append(apply_blur(image, config["blur_kernel"]))            # Gaussian blur
    return augmented_images

